mapper.select:

select

from t_shipping_package
where shipping_instruction_no = #{shippingInstructionNo,jdbcType=NUMERIC}
and wno = #{wno,jdbcType=CHAR}
and package_no = #{packageNo,jdbcType=CHAR}

mapper.delete:

delete from t_shipping_package
where shipping_instruction_no = #{shippingInstructionNo,jdbcType=NUMERIC}
and wno = #{wno,jdbcType=CHAR}
and package_no = #{packageNo,jdbcType=CHAR}
